import React from 'react';
import Card from '../card/Card';
import Hr from '../hr/Hr';
import './projects.css';

class Projects extends React.Component {

    state ={

    }

    render() {
        return(
            <React.Fragment>
                <section id='projects' className='container-fluid'>
                    <div className='subtitle-box'>
                        <h3 className='subtitle is-3 has-text-centered' id='portfolio'>PORTFOLIO</h3>
                        <Hr />
                    </div>

                    <div className='block'>
                        <div className='columns is-desktop project-columns'>
                            <Card name='Crystal Collector' projectLink='https://ziyadguluzade.github.io/crystal-collector/' githubLink='https://github.com/ZiyadGuluzade/crystal-collector' target='_blank' src={require('../../images/projects/amatista.jpg')} description='HTML5, CSS3, Javascript, jQuery'/>

                            <Card name='Crystal Collector' projectLink='https://ziyadguluzade.github.io/crystal-collector/' githubLink='https://github.com/ZiyadGuluzade/crystal-collector' target='_blank' src={require('../../images/projects/amatista.jpg')} description='HTML5, CSS3, Javascript, jQuery'/>


                            <Card name='Personal Expense Tracker' src={require('../../images/projects/expense_tracker_app.jpg')} description='A web application that helps to calculate personal expenses/income '/>    
                        </div>

                        <div className='columns is-desktop project-columns'>
                            <Card name='Google Books' projectLink='https://zguluzade-google-book-search.herokuapp.com/' githubLink='https://github.com/ZiyadGuluzade/google-books-app' target='_blank'  src={require('../../images/projects/google_books_app.jpg')} description='A web application for book lovers'/>

                            <Card name='Jeopardy Game' projectLink='https://jeopardy-tribute.herokuapp.com/' githubLink='https://github.com/kmajor1/jeopardy' target='_blank' src={require('../../images/projects/jeopardy-game.jpeg')} description='React, Javascript, MongoDB, Node, Express, CSS3' />

                            <Card name='ATP Tennis Cards' projectLink='https://jeopardy-tribute.herokuapp.com/' githubLink='https://github.com/kmajor1/jeopardy' target='_blank' src={require('../../images/projects/memory_cards_game.jpg')} description='React, Javascript, MongoDB, Node, Express, CSS3' />
                        </div>   
                    </div>
                </section>
            </React.Fragment>
        )
    }
}

export default Projects;
